import React from 'react';
import {
    Container,
    FormContainer,
    Title,
    InputLabel,
    Input,
} from '../styles/LoginStyles';
import axios from 'axios';

export default function Login() {
    const [Email , setEmail] = useState(null)
const [Username , setUsername] = useState(null)


    return (
        <Container>
            <FormContainer>
                <Title>Login</Title>
                <InputComponent name={'Email'} placeholder='Write your email' type='email'/>
                {/* <InputComponent name='correo' /> */}
            </FormContainer>
        </Container>
    );
}

function InputComponent({
    name,
    placeholder,
    type,
    callbackFunction
}: {
    name: string;
    placeholder: string;
    type: 'email' | 'name' | 'number';
    callbackFunction: () => {}
}) {
    return (
        <>
            <InputLabel>{name}</InputLabel>
            <Input
                type={type}
                placeholder={placeholder}
                
            />
        </>
    );
}
